DROP TABLE IF EXISTS `expenses`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `expenses` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `tenantID` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `amount` decimal(13,2) NOT NULL,
  `category_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `note` text COLLATE utf8_unicode_ci,
  `ref_no` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `currency_code` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `merchant_id` int(10) unsigned DEFAULT NULL,
  `expense_date` date DEFAULT NULL,
  `recurring` int(11) NOT NULL DEFAULT '0',
  `recur_schedule` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `recur_status` int(11) NOT NULL DEFAULT '1',
  `recur_next_date` date DEFAULT NULL,
  `created_from_recurring` int(11) NOT NULL DEFAULT '0',
  `recurring_start_date` date DEFAULT NULL,
  `recurring_end_date` date DEFAULT NULL,
  `file` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `archived` int(11) DEFAULT NULL,
  `tax1_val` decimal(13,2) DEFAULT NULL,
  `tax2_val` decimal(13,2) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `expenses_merchant_id_foreign` (`merchant_id`),
  KEY `expenses_tenantid_foreign` (`tenantID`),
  CONSTRAINT `expenses_merchant_id_foreign` FOREIGN KEY (`merchant_id`) REFERENCES `merchants` (`id`) ON DELETE CASCADE,
  CONSTRAINT `expenses_tenantid_foreign` FOREIGN KEY (`tenantID`) REFERENCES `tenants` (`tenantID`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=181 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

