  `tax_perc` int(11) DEFAULT NULL,
  `note` text COLLATE utf8_unicode_ci,
  `subject` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `file` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `token` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `receipt` int(11) NOT NULL DEFAULT '0',
  `bankinfo` int(11) NOT NULL DEFAULT '1',
  `last_payment_date` date DEFAULT NULL,
  `subtotal` decimal(13,2) NOT NULL,
  `balance_due` decimal(13,2) NOT NULL,
  `discount_val` decimal(13,2) DEFAULT NULL,
  `tax_val` decimal(13,2) DEFAULT NULL,
  `client_id` int(10) unsigned NOT NULL,
  `tenant_invoice_id` int(11) NOT NULL DEFAULT '0',
  `tenant_quote_id` int(11) NOT NULL DEFAULT '0',
  `status` int(11) NOT NULL DEFAULT '0',
  `business_model` int(11) NOT NULL DEFAULT '0',
  `bill_option` int(11) NOT NULL DEFAULT '0',
  `enable_discount` int(11) NOT NULL DEFAULT '1',
  `enable_tax` int(11) NOT NULL DEFAULT '1',
  `reminder3` int(11) NOT NULL DEFAULT '0',
  `reminder7` int(11) NOT NULL DEFAULT '0',
  `set_reminder` int(11) NOT NULL DEFAULT '0',
  `recurring` int(11) NOT NULL DEFAULT '0',
  `recur_schedule` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `recur_due_date_interval` int(11) DEFAULT NULL,
  `recur_status` int(11) NOT NULL DEFAULT '1',
  `recur_next_date` date DEFAULT NULL,
  `created_from_recurring` int(11) NOT NULL DEFAULT '0',
  `auto_send` int(11) NOT NULL DEFAULT '1',
  `recurring_start_date` date DEFAULT NULL,
  `recurring_end_date` date DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `invoices_tenant_quote_id_index` (`tenant_quote_id`),
  KEY `invoices_tenant_invoice_id_index` (`tenant_invoice_id`),
  KEY `invoices_client_id_foreign` (`client_id`),
  KEY `invoices_tenantid_foreign` (`tenantID`),
  CONSTRAINT `invoices_client_id_foreign` FOREIGN KEY (`client_id`) REFERENCES `clients` (`id`) ON DELETE CASCADE,
  CONSTRAINT `invoices_tenantid_foreign` FOREIGN KEY (`tenantID`) REFERENCES `tenants` (`tenantID`) ON DELETE CASCADE
